<html>
	<meta http-equiv='Content-Type' content='text/html; charset=utf-8' />
	<head>
		<style type="text/css">

				@font-face {
					font-family: KAP119;
					src: url('C:/xampp/htdocs/kvo-app/vendor/dompdf/dompdf/lib/fonts/KAP119.ttf');
				}

				@page  
				{ 
					margin: 20px 30px;  
				} 

				.gujfont{
					font-family: "KAP119" !important;
					font-size: 16px !important;
				}

				.table1{
				border-top: 2px solid black;
				border-bottom: 0px;
				border-right: 2px solid black;
				border-left: 2px solid black;
				border-collapse: collapse;
				}

				.table2{
				border-top: 0px;
				border-bottom: 0px;
				border-right: 2px solid black;
				border-left: 2px solid black;
				border-collapse: collapse;
				}

				.table3{
				border-top: 0px;
				border-bottom: 2px solid black;
				border-right: 2px solid black;
				border-left: 2px solid black;
				border-collapse: collapse;
				}

				.tac{
					text-align: center !important;
				}

				table.table2.tg td:nth-child(1) {
					text-align: center;
				}

				table.table2.tg td:nth-child(2) {
					padding-left: 15px !important;
				}

				table.table2.tg td:nth-child(3) {
					text-align: center;
					vertical-align: middle !important;
				}

				td.tg-0pky.sign {
					text-align: center !important;
					vertical-align: bottom !important;
					width: 20% !important;
				}

				tr {
					height: 27px;
				}

				th.imgcenter{
					text-align: center !important;
				}

				.title{
					text-align: center !important;
					font-weight: bolder !important;
				}

		</style>
		<style type="text/css">
			.tg  {border-collapse:collapse;border-spacing:0;}
			.tg td{border-color:black;border-style:solid;border-width:0px 1px 1px 1px;font-family:Arial, sans-serif;font-size:14px;
			  overflow:hidden;padding:10px 5px;word-break:normal;}
			.tg th{border-color:black;border-style:solid;border-width:1px;font-family:Arial, sans-serif;font-size:14px;
			  font-weight:normal;overflow:hidden;padding:10px 5px;word-break:normal;}
			.tg .tg-0pky{border-color:inherit;text-align:left;vertical-align:top}
            .tg .tg-vask{font-size:25px;text-align:center;vertical-align:middle;padding: 10px;}
			</style>
	</head>
	<body>
			<table class="table1 tg" style="width: 740px">
				<tbody>
				<tr>
					<th class="tg-0pky imgcenter" colspan="2"><img src=data:image/png;base64," style="height:105px;"></th>
				</tr>
				<tr>
					<td class="tg-0pky" width="80%">Receipt No: {{$medical[0] -> sr_no}}</td>
					<td class="tg-0pky">Date: {{Date('d-m-Y',strtotime($medical[0] -> date))}}</td>
				</tr>
				<tr>
					<td class="tg-0pky" colspan="1">Patient's Name: {{$medical[0] -> m_name}}</td>
					<td class="tg-0pky" colspan="1">Mobile No: {{$medical[0] -> phone_no}}</td>
				</tr>
                <tr>
					<td class="tg-0pky" colspan="2">City: {{$medical[0] -> city}}</td>
				</tr>
                <tr>
					<td class="tg-0pky" colspan="2">Doctor's Name: {{$medical[0] -> doctor_name}}</td>
				</tr>
                <tr>
					<td class="tg-0pky" colspan="2">Treatment: {{$medical[0] -> remark}}</td>
				</tr>
                <tr>
					<td class="tg-0pky" colspan="2">In Word: {{$medical[0] -> amount_in_words}}</td>
				</tr>
				</tbody>
			</table>

			<table class="table3 tg" style="width: 740px">
			  <tbody>
				<tr>
                    <td><span class="tg-vask"><img style="margin-right: 10px;margin-left: 10px;" src="data:image/svg+xml,%3csvg xmlns='http://www.w3.org/2000/svg' viewBox='0 0 320 512'%3e%3cpath fill='#000000' d='M308 96c6.627 0 12-5.373 12-12V44c0-6.627-5.373-12-12-12H12C5.373 32 0 37.373 0 44v44.748c0 6.627 5.373 12 12 12h85.28c27.308 0 48.261 9.958 60.97 27.252H12c-6.627 0-12 5.373-12 12v40c0 6.627 5.373 12 12 12h158.757c-6.217 36.086-32.961 58.632-74.757 58.632H12c-6.627 0-12 5.373-12 12v53.012c0 3.349 1.4 6.546 3.861 8.818l165.052 152.356a12.001 12.001 0 0 0 8.139 3.182h82.562c10.924 0 16.166-13.408 8.139-20.818L116.871 319.906c76.499-2.34 131.144-53.395 138.318-127.906H308c6.627 0 12-5.373 12-12v-40c0-6.627-5.373-12-12-12h-58.69c-3.486-11.541-8.28-22.246-14.252-32H308z'/%3e%3c/svg%3e" height="20px">: {{$medical[0] -> amount}} </span></td>
				  <td class="tg-0pky sign" height="70px">Sign</td>
				</tr>
			  </tbody>
			</table>
	</body>
</html>